import React from "react";
import "./Side.scss";

class Side extends React.Component {
  render() {
    //   console.log(this.props.sideVideo.image)
    return (
      <div className="sideVideo">
        {/* <img src={this.props.side.image} /> */}
        <img className="sideVideo__img" src={this.props.data.image} />
        <div className="sideVideo__title">{this.props.data.title}</div>
        <div className="sideVideo__channel">{this.props.data.channel}</div>
      </div>
    );
  }
}

export default Side;
